    /**
     * Gets voci
     *
     * @return \GovPay\Backoffice\Model\VocePendenza[]
     */
    public function getVoci()
    {
        return $this->container['voci'];
    }

    /**
     * Sets voci
     *
     * @param \GovPay\Backoffice\Model\VocePendenza[] $voci voci
     *
     * @return self
     */
    public function setVoci($voci)
    {
        if (is_null($voci)) {
            throw new \InvalidArgumentException('non-nullable voci cannot be null');
        }

        if ((count($voci) > 5)) {
            throw new \InvalidArgumentException('invalid value for $voci when calling Pendenza., number of items must be less than or equal to 5.');
